import React from 'react';
import { TECarousel, TECarouselItem } from 'tw-elements-react';

export const Carousel = () => {
  return (
    <div className="max-h-100 overflow-hidden"> {/* Adjust the max height here */}
      <TECarousel showControls ride="carousel" interval={2000}> {/* Set the interval in milliseconds */}
        <TECarouselItem itemID={1} className="relative">
          <img
            src="https://mdbcdn.b-cdn.net/img/new/slides/041.webp"
            className="block w-full"
            alt="..."
          />
        </TECarouselItem>
        <TECarouselItem itemID={2} className="relative">
          <img
            src="https://mdbcdn.b-cdn.net/img/new/slides/042.webp"
            className="block w-full"
            alt="..."
          />
        </TECarouselItem>
        <TECarouselItem itemID={3} className="relative">
          <img
            src="https://mdbcdn.b-cdn.net/img/new/slides/043.webp"
            className="block w-full"
            alt="..."
          />
        </TECarouselItem>
      </TECarousel>
    </div>
  );
};

export default Carousel;
